import React from 'react';
import '../css/Header.css';

const Header = () => {
    return (
        <div>
            <div className='row'>
                 <div className='col-6'>
                   <div className='col-2'>
                   <h3>anush</h3> 
                   </div>
                   <div className='col-4 he2'>                 
                   <p>Gift Selection, Simplified</p>
                   </div>
                  </div>
                  <div className='imgbg col-6'>
                  
                  </div>
            </div>
        </div>
    )
}

export default Header;
